import React from 'react';
import '../assets/css/ToDos.css'

const List = (props) => {
  return (
    <div className="list">
      <div className="todo-card">
        <input type="checkbox" />
        <span>{props.toDos[0].task}</span>
        <spacer />
        <button>Delete</button>
      </div>
    </div>
  );
}

export default List;
